// src/components/ClassCard.js
import React from "react";

const ClassCard = ({ cls, onClick }) => {
  return (
    <div className="card" onClick={() => onClick(cls)}>
      <h3>{cls.subject.name}</h3>
      <p>Grade: {cls.grade}</p>
      <p>Teacher: {cls.teacher.name}</p>
      <p>Fee: ${cls.fee}</p>
    </div>
  );
};

export default ClassCard;
